        public static void FindMostCarriedCalories(string input)
        {
            string[] elvesCaloriesArray = input.Split("\r\n\r\n");

            int[] mostCalories = new int[3] { 0, 0, 0 };
            

            foreach(string elfCalories in elvesCaloriesArray)
            {
                string[] calories = elfCalories.Split("\r\n");
                int sumCalorie = calories.Sum((calorie) => int.Parse(calorie));
                for (int i = 0; i < mostCalories.Length; i++)
                {
                    if(sumCalorie > mostCalories[i])
                    {
                        mostCalories[i] = sumCalorie;
                        break;
                    }
                }
            }

            Console.WriteLine(mostCalories.Sum());
        }
    }
